        .to('.wedding_name .i1path', 0.5, { autoAlpha: 1, ease: Linear.easeNone, force3D: true, onComplete: () => { this.t.p2 = true }, delay: 0.5 })
        .to('.wedding_name .n1path', 0.5, { autoAlpha: 1, ease: Linear.easeNone, force3D: true, onComplete: () => { this.t.p3 = true } })
